<?php

$price = 500000;
$allCombo = [
    '1' => $price,
    '2' => $price * 2 - 100000,
    '3' => 1300000,
    '5' => 1700000,
    '7' => 3150000,
];
$numOfProducts = 10;
$combos = [1];
$currentProductCount = [0];
$minPrice = $numOfProducts * $price;

function calculateMinTotal($allCombo, $numOfProducts, $combos, $currentProductCount, $minPrice, $i) 
{
    $comboKeys = array_keys($allCombo);
    for ($j = $combos[$i - 1]; $j <= ($numOfProducts - $currentProductCount[$i - 1]); $j++)
    {
        if (!in_array($j, $comboKeys)) {
            continue;
        }
        $combos[$i] = $j;
        $currentProductCount[$i] = $currentProductCount[$i - 1] + $j;
        if ($currentProductCount[$i] == $numOfProducts) {
            $total = 0;
            echo '<li>';
            for ($k = 1; $k <= $i; $k++) {
                $total += $allCombo[$combos[$k]];
                echo $combos[$k]  . ' ';
            }

            echo 'total: ' . $total .'</li>';
            if ($total < $minPrice) {
                $minPrice = $total;
            }
        } else {
            $minPrice = calculateMinTotal($allCombo, $numOfProducts, $combos, $currentProductCount, $minPrice, $i + 1);
        }
    }

    return $minPrice;
}

echo 'Min: ' . calculateMinTotal($allCombo, $numOfProducts, $combos, $currentProductCount, $minPrice, 1);

```

